import React from 'react'
import {TopHeader} from "./topHeader/TopHeader"
import {BottomHeader} from "./bottomHeader/BottomHeader"
import {useStyles} from './useStyle'


export const Header = () => {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <TopHeader/>
            <BottomHeader/>
        </div>
    )
}
